import './style.css'

const Blog = () => {
    return(
        <section id="blog">
        <h1 class="heading">Bl<span>og</span></h1>
        <div className="blog-box">
        <div className="blog-img">
            <img src={require('../../Assets/Images/blog 4.jpg')} alt=""/>
        </div>
        
</div>
        </section>
    )
}
export default Blog;
